  `db_id` int(11) NOT NULL COMMENT '数据库id',
  `tbl_type` tinyint(1) DEFAULT 1 COMMENT '表类型(1：外部表、2：内部表，默认1)',
  `tbl_mapping_type` tinyint(1) DEFAULT 0 COMMENT '表映射类型(1：映射es表、2：映射hbase表，默认0)',
  `tbl_location_uri` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '表HDFS路径',
  `owner` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '创建者用户名',
  `modifier` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '更新者用户名',
  `life_cycle` int(11) DEFAULT 999999 COMMENT '生命周期(30：一个月，90：三个月，180:6个月，270:9个月，360：一年，999999：永远)',
  `error_type` tinyint(1) DEFAULT 0 COMMENT '影响使用(0：正常，1：不影响，2：不影响，默认0)',
  `format_type` tinyint(1) DEFAULT NULL COMMENT '存储格式(0：无，1:TEXT，2:ORC,-1:SequenceFile,-9其他)',
  `column_split` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '列分隔符',
