  `tbl_create_time` varchar(255) COMMENT '表创建时间',
  `tbl_modify_time` varchar(255) COMMENT '表修改时间',
  `is_delete` tinyint(1) DEFAULT 0 COMMENT '是否删除，0: 不删除，1：删除，默认0',
  `create_time` varchar(255) COMMENT '创建时间',
  `update_time` varchar(255) COMMENT '更新时间',
  `delete_time` varchar(255) COMMENT '删除时间',
  `source_type` tinyint(1) DEFAULT 4 COMMENT '表来源类型(1：Flume准实时写入:2：DTS批量导入:3：老mysql同步方式:4：其他',
  PRIMARY KEY (`id`) USING BTREE,
